import './App.css';
import { Header } from './components/Header';

import {
  BrowserRouter as Router,
  Route,
  Link,
  Routes
} from "react-router-dom";
import { Home } from './views/Home';

function App() {
  return (
    <div className="App">
      <Router>

        <Routes>
          <Route path='/' element= {<Home />}>
          </Route>
        </Routes>
        </Router>
    </div>
  );
}

export default App;
